import React from 'react';
import { render } from "react-dom"
import './index.css';
import * as serviceWorker from './serviceWorker';
import transitApi from './data/transit-api';
import iBusApi from './data/ibus-api';
import { HashRouter, Switch, Route } from "react-router-dom";
import Landing from './componets/Landing';
import Login from './componets/Login';
import Register from './componets/Register';
import Home from './componets/Home';
import StopCode from './componets/StopCode';
import Results from './componets/Results';
import StopLine from './componets/StopLine';
import Favorites from './componets/Favorites';


transitApi.APP_ID = process.env.REACT_APP_APP_ID
transitApi.APP_KEY = process.env.REACT_APP_APP_KEY

iBusApi.APP_ID = process.env.REACT_APP_APP_ID
iBusApi.APP_KEY = process.env.REACT_APP_APP_KEY

const App = () => (
    <HashRouter> /{/* envolvemos nuestra aplicación en el Router  */}
      <Switch> {/* también la envolvemos en el componente Switch */}
        <Route path="/" component={Landing} exact /> {/* y creamos nuestras rutas */}
        <Route path="/login" component={Login} exact />
        <Route path="/register" component={Register} exact />
        <Route path="/home" component={Home} exact />
        <Route path="/home/stopcode" component={StopCode} exact />
        <Route path="/home/stopcode/results" component={Results} exact />
        <Route path="/home/linecode" component={StopLine} exact />
        <Route path="/home/linecode/results" component={Results} exact />
        <Route path="/home/favorites" component={Favorites} exact />
        <Route path="/home/favorites/results" component={Results} exact />
      </Switch>
    </HashRouter>
  )

  render(<App />, document.getElementById("root"))

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();

//Pg 19 manual: The road to learn React
if (module.hot) {
    module.hot.accept();
}
